        <div>
            <div class="team-info" data-name="jendayi">
                <p class="team-member-role">Advisory Board</p>
                <p class="team-member-name">
                    Jendayi Frazer <br />
                    Principal
                </p>
                <p class="team-member-description">
                    She served as the U.S. Assistant Secretary of State for African Affairs from 2005 to 2009. She was
                    Special Assistant to the President and Senior Director for African Affairs at the National Security
                    Council from 2001 until her swearing-in as the first woman U.S. Ambassador to South Africa in 2004.
                    She previously served in government from 1998 to 1999 as a CFR International Affairs Fellow, first
                    at the Pentagon as a political-military planner with the Joint Chiefs of Staff, working on West
                    Africa during Nigeria’s transition to civilian rule, and then as Director for African Affairs at the
                    National Security Council, working on Central and East Africa.
                    <br />
                    Ms. Frazer founded a consulting and investment firm, 50 Ventures, LLC in 2011 that helps companies
                    navigate market entry and expansion in Africa. Frazer is the Managing Partner and Chairman of Africa
                    Exchange Holdings, Ltd. (AFEX), a private sector company that is building commodity exchanges in
                    Rwanda and Nigeria to provide small-scale farmers with access to storage, information and financing
                    to strengthen their market participation.
                    <br />
                    Frazer is Adjunct Senior Fellow for Africa Studies at the Council on Foreign Relations (CFR).
                    She was most recently a Visiting Professor at Columbia University’s School of International and
                    Public Affairs. She was a Distinguished Public Service Professor at Carnegie Mellon University from
                    2009 to 2014, where she was on the faculty of Heinz College’s School of Public Policy and
                    Management. She was also an Assistant Professor at Harvard University and University of Denver. Her
                    research focused
                    on strengthening regional security cooperation and economic and political integration in Africa. The
                    author of and contributor to a number of articles, journals, and books, she is the co-editor of
                    Preventing Electoral Violence in Africa (2011).
                    <br>
                    Frazer serves on the non-profit boards of The MasterCard Foundation based in Toronto, Canada, The Mo
                    Ibrahim Foundation in London, The Africa Center in New York, the King Baudouin Foundation in New
                    York, and the publically traded Teranga Gold Corporation based in Toronto with operations in
                    Senegal, Cote d’Ivoire, and Burkina Faso.
                    <br>
                    Frazer received her BA in political science (with honors) and African and Afro-American studies
                    (with distinction), MAs in international policy studies and international development education, and
                    PhD in political science, all from Stanford University
                </p>
